create table Patient_DATA (
	PatientID VARCHAR(50),
	Username VARCHAR(50),
	Password VARCHAR(50),
	Name VARCHAR(50),
	Whether_hospitalized VARCHAR(50),
	Phonenumber VARCHAR(50),
	MajorAttendingphysician VARCHAR(50),
	Prescriptiondrugs VARCHAR(500),
	Balance VARCHAR(50),
	MedicineID VARCHAR(50),
	Roomnumber INT
);

